let containerStyle = {
  display: "flex",
  width: "calc(65vw - 28px)",
  minWidth: "400px",
  marginTop: "-10px",
  fontWeight: "bold"
}

let macStyle = {
  listStyleType: "none",
  fontSize: "17px",
  // minWidth: "200px",
  // height: "22px",
  textAlign: "center",
  // borderRadius: "3px",
  fontWeight: "bold"
}

let macStyleHighlighted = {
  ...macStyle, backgroundColor: "#4382BC",
}

let indexStyle = {
  listStyleType: "none",
  display: "flex",
  width: "100%",
  height: "22px",
}

let indexSeparatorContainer = {
  width: "11px", 
  height: "22px", 
  cursor: "col-resize"
}

let indexSeparator = {
  display: "block",
  marginLeft: "auto",
  marginRight: "auto",
  width: "1px", 
  height: "22px", 
  backgroundColor: "#4382BC"
}

export {
  containerStyle,
  macStyle,
  macStyleHighlighted,
  indexStyle,
  indexSeparator,
  indexSeparatorContainer
}
